import React,{ Component,Fragment } from 'react'

import classes from './Button.css'

const button = ( props ) => {
    let style = {};
    if (props.value==='=') {
        style['Background:'] = '#0CB999'
    }

    return (<input type="button"
                   value={props.value}
                   onClick={props.clicked} style={style}/>);
};
export default button;
